// src/components/Nav.js
import React from 'react';

const Nav = () => {
  return (
    <div className="nav">
      <h2>GRAINEE</h2>
      <div className="menu">
        <p>About us</p>
        <p>Our Mission</p>
        <p>Contact us</p>
      </div>
    </div>
  );
};

export default Nav;
